import logo from "./logo.svg";
import "./App.css";

function App() {
  let player = "X";
  let tbGame = [
    ["", "", ""],
    ["", "", ""],
    ["", "", ""],
  ];

  function Square({ value, onSquareClick }) {
    return (
      <button className="square" onClick={onSquareClick}>
        {value}
      </button>
    );
  }

  return (
    <div className="App">
      <header className="App-headers">
        <p>X/O Game</p>
      </header>
      <body>
        <div className="">
          <table>
            <tr>
              <Square className="st table" onclick="" />
              <td className="st table" onclick="placeMarker(0, 1)"></td>
              <td className="st table" onclick="placeMarker(0, 2)"></td>
            </tr>
            <tr>
              <td className="st table" onclick="placeMarker(1, 0)"></td>
              <td className="st table" onclick="placeMarker(1, 1)"></td>
              <td className="st table" onclick="placeMarker(1, 2)"></td>
            </tr>
            <tr>
              <td className="st table" onclick="placeMarker(2, 0)"></td>
              <td className="st table" onclick="placeMarker(2, 1)"></td>
              <td className="st table" onclick="placeMarker(2, 2)"></td>
            </tr>
          </table>
        </div>
      </body>
    </div>
  );
}
const checktb = () => {};

